import React, {Component} from 'react'
import './item.css'
import { CaretLeft,CaretRight} from '@phosphor-icons/react'

class Item extends Component {
    constructor(props) {
        super(props)
        this.state = {
            first:0
        }}

        changeimg = ()=>{
            const swr = document.querySelectorAll('.secondary img')

            swr.forEach((sora)=>{
                sora.addEventListener('click',()=>{
                    document.querySelector('.main').src = sora.src
                })
            })
        }

    render() {
        return (
            <div className='item'>
                <div className='item-content'>
                    <div className='left'>
                        <img src='https://api.yeshtery.com/v1/yeshtery/files/31/he4717-12.jpg?height=568' className='main' />
                        <div className='secondary'>
                            <CaretLeft size={32} weight="bold" />
                            <img src='https://api.yeshtery.com/v/yeshtery/files/31/he4717-12.jpg?height=568' />
                            <img src='https://api.yeshtery.com/v1/yeshtery/files/31/he4717-12.jpg?height=568' />
                            <img src='https://api.yeshtery.com/v1/yeshtery/files/31/he4717-12.jpg?height=568' />
                            <CaretRight size={32} weight="bold" />
                        </div>
                    </div>
                    <div className='right'>

                    </div>
                </div>
            </div>
        )}}

export default Item
